  false,\n\t\"url\": null,\n\t\"notes\": \"This is a polygon shapefile of publicly
  accessible waterfront spaces in NYC containing jurisdictional and construction status
  information. The majority of these spaces were constructed in conjunction with private
  waterfront developments, pursuant to the NYC Zoning Resolution.u00a0 This feature
  class also includes spaces that are under construction (in progress), or have been
  approved through ULURP (Uniform Land Use Review Procedure) but construction of the
  waterfront spaces has not commenced.u00a0 The publicly owned spaces in this database
  do not include parks or open spaces under the jurisdiction of NYC Department of
  Parks and Recreation, NYS Office of Parks, Recreation & Historic Preservation, or
  the National Park Service.u00a0 This shapefile was used to create the City Waterfront
  Interactive Maps at http://www.nyc.gov/html/dcp/html/cwp/cw.shtml .\",\n\t\"license_title\":
